import React from "react";
import Navbar from "../HomePage/Navbar";

const MyJobs=()=>{
    return(
        <>
            <Navbar/>
            <div className="profile-card profile-container">
                    <h4><b>My Jobs</b></h4>
                    <a href="/profile/myjobs" className="see-btn">See more...</a>
            </div>
        </>
    );
};

export default MyJobs;
